import { Routes, Route } from 'react-router-dom';
import Home from './routes/home/home.component';



const Navigation = () => (
  <div>
    <div>
      <h1></h1>
    </div>
  </div>
);

const App = () => (
  <Routes>
    <Route path="/" element={<Home />} />
    <Route />
  </Routes>
);

export default App;
